    Tendenza parametri meteorologici settimana dal {{dates.0|date:"d/m"}} al {{dates.6|date:"d/m"}}  










          1. Molto basso
          A fronte di un innesco non consegue necessariamente la propagazione del fronte di fiamma.


          2. Basso
          La propagazione del fuoco avviene solo a seguito di un innesco importante, ma comunque lenta. L'estinzione è facilmente realizzabile.


          3. Medio
          Gli eventiuali incendi si propagano con moderata velocità. L'estinzione è efficace se attuata tempestivamente.


          4. Elevato
          A seguito di un innesco il fronte di fiamma si può diffondere molto rapidamente e la sua estinzione risulta difficile.


          5. Molto elevato
          A seguito di un innesco possono verificarsi incendi che si propagano con violenza e la cui estionzione è oltremodo impegnativa e di difficile riuscita.













